import List from "./List";

const TreeList = ({ data, onListToggle, toggleKey, onDelete }) => {
  return (
    <div className="list">
      {/* <h5>Checking the list view</h5>a */}
      {Object.keys(data).length ? (
        <List list={data} toggleKey={toggleKey} onDelete={onDelete} value="" />
      ) : (
        "No List"
      )}
    </div>
  );
};

export default TreeList;
